        view
        returns (
            string memory,
            string memory,
            string memory,
            string memory,
            string memory,
            string memory,
            string memory
        )
    {
        require(isApproved[_address][msg.sender], "Access denied");
        Patients memory p = patients[_address];
        return (p.ic, p.name, p.phone, p.gender, p.dob, p.height, p.weight);
    }

