    }

    // Search appointment details by entering a patient address
    function searchAppointment(
        address _address
    )
        public
        view
        returns (
            address,
            string memory,
            string memory,
            string memory,
            string memory,
            string memory,
            string memory
        )
    {
        // Use memory for reading appointment data
        Appointments memory a = appointments[_address];

